// Base64 encoded images for GlitchBox
// This file contains all base64 images used in the application

const BASE64_IMAGES = {
    CURSOR_ICON: "data:image/png;base64,",
    USER_ICON: "data:image/png;base64,",
    FRIENDS_ICON: "data:image/png;base64,",
    LOGOUT_ICON: "data:image/png;base64,",
};

// Helper function to get image by name
function getBase64Image(name) {
    return BASE64_IMAGES[name] || '';
}
